import React from 'react';
import './App.css';

function Misimagenes() {
  return (
    <>
      <div className="image-container">
        <img src={require('./imagenes/mueble-1.jpg')} alt="mueble-1" className="galeria-image" />
        <img src={require('./imagenes/mueble-2.jpg')} alt="mueble-2" className="galeria-image" />
        <img src={require('./imagenes/mueble-3.jpg')} alt="mueble-3" className="galeria-image" />
        <img src={require('./imagenes/mueble-4.jpg')} alt="mueble-4" className="galeria-image" />
        <img src={require('./imagenes/mueble-5.jpg')} alt="mueble-5" className="galeria-image" />
        <img src={require('./imagenes/mueble-1.jpg')} alt="mueble-1" className="galeria-image" />
        <img src={require('./imagenes/mueble-2.jpg')} alt="mueble-2" className="galeria-image" />
        <img src={require('./imagenes/mueble-3.jpg')} alt="mueble-3" className="galeria-image" />
        <img src={require('./imagenes/mueble-4.jpg')} alt="mueble-4" className="galeria-image" />
        <img src={require('./imagenes/mueble-5.jpg')} alt="mueble-5" className="galeria-image" />
      </div>
    </>
  );
}

class Galeria extends React.Component {
  render() {
    return (
      <div className="galeria-container">
        <h2 className="galeria-title text-center">Galería de Imágenes</h2>
        <p className="text-center">Explora nuestras imágenes y descubre más sobre nuestros productos.</p>
        <div className="galeria-images">
          <Misimagenes />
        </div>
      </div>
    );
  }
}

export default Galeria;
